import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
// @material-ui/icons
// core components
import Header from "components/Header/Header.jsx";
import Footer from "components/Footer/Footer.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import Button from "components/CustomButtons/Button.jsx";
import Parallax from "components/Parallax/Parallax.jsx";
import Card from "components/Card/Card.jsx";
import CardBody from "components/Card/CardBody.jsx";
import CardHeader from "components/Card/CardHeader.jsx";
import CardFooter from "components/Card/CardFooter.jsx";
import FavoriteBorder from '@material-ui/icons/FavoriteBorder';
import Favorite from '@material-ui/icons/Favorite';
import Chat from '@material-ui/icons/Chat';
import MoreHoriz from '@material-ui/icons/MoreHoriz';
import Dialog from '@material-ui/core/Dialog';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

import componentsStyle from "assets/jss/material-kit-react/views/components.jsx";
//import { Card } from "@material-ui/core";

class Components extends React.Component {
  render() {
    const { classes, ...rest } = this.props;
    const cardStyle = {width:"60rem", height:"30rem", margin:"5rem"};
    const [open, setOpen] = React.useState(false);
    const Transition = React.forwardRef(function Transition(props, ref) {
      return <Slide direction="up" ref={ref} {...props} />;
    });

    function handleClickOpen() {
      setOpen(true);
    }

    function handleClose() {
      setOpen(false);
    }
    return (
      <div>
        <Header
          brand="GSM ASSEMBLE"
          fixed
          color="transparent"
          changeColorOnScroll={{
            height: 400,
            color: "white"
          }}
          {...rest}
        />
        <Parallax image={require("assets/img/bg.jpg")}>
          <div className={classes.container}>
            <GridContainer>
              <GridItem>
                <div className={classes.brand}>
                  <h1 className={classes.title}>GSM ASSEMBLE</h1>
                  <h3 className={classes.subtitle}>
                    Let's make team for the competition.
                  </h3>
                </div>
              </GridItem>
            </GridContainer>
          </div>
        </Parallax>

        <div className={classNames(classes.main, classes.mainRaised)}>
          <div className={classes.container}>
            <GridContainer justify="center" direction="column">
              <GridItem>
                <Card style={cardStyle}>
                  <CardHeader color="danger">
                    <a style={{fontSize:"20px", color:"white"}}>▶</a>
                    <Button justIcon round simple>
                      <MoreHoriz className={classes.Icon} />
                    </Button>
                  </CardHeader>
                  <CardBody style={{margin:"20px"}}>
                    <p>이 곳에 작성할 내용이 써진다.</p>
                  </CardBody>
                  <CardFooter>
                    <Button justIcon round color="rose">
                      <FavoriteBorder className={classes.Icon} />
                    </Button>
                    <Button justIcon round color="info" onClick={handleClickOpen}>
                      <Chat className={classes.Icon} />
                    </Button>
                  </CardFooter>
                </Card>
              </GridItem>
            </GridContainer>

            <Dialog
              open={open}
              TransitionComponent={Transition}
              keepMounted
              onClose={handleClose}
              aria-labelledby="alert-dialog-slide-title"
              aria-describedby="alert-dialog-slide-description"
            >
              <DialogTitle id="alert-dialog-slide-title">{"Use Google's location service?"}</DialogTitle>
              <DialogContent>
                <DialogContentText id="alert-dialog-slide-description">
                  Let Google help apps determine location. This means sending anonymous location data to
                  Google, even when no apps are running.
                </DialogContentText>
              </DialogContent>
            </Dialog>
          </div>
        </div>
      </div>
    );
  }
}

Components.propTypes = {
  classes: PropTypes.object
};

export default withStyles(componentsStyle)(Components);
